
create  table groupes (
id smallserial primary key,
name Varchar(10)
);

create table subjects(
id smallserial primary key,
name Varchar(20)
);

create table lecturers( 
id smallserial primary key,
first_name Varchar(30),
last_name Varchar(30)
);

create table students (
id smallserial primary key,
first_name Varchar(30),
last_name Varchar(30),
id_group smallint references groupes (id) on update cascade,
constraint uniq_stud_group unique (id, id_group)
);

create table groupes_subjects(
id_group smallint references groupes (id) on update cascade,
id_subject smallint references subjects (id) on update cascade,
primary key (id_group, id_subject),
constraint uniq_group_subj unique (id_group, id_subject)
);

create table subjects_lectures(
id_subject smallint references subjects (id) on update cascade,
id_lecturer smallint references lecturers (id) on update cascade,
primary key (id_lecturer, id_subject),
constraint uniq_subj_lect unique (id_subject, id_lecturer)
);

create table group_subject_lecturer(
id smallserial primary key,
id_group smallint references groupes (id) on update cascade,
id_subject smallint references subjects (id) on update cascade,
id_lecturer smallint references lecturers (id) on update cascade,
constraint uniq_group_subj_lect unique (id_group, id_subject, id_lecturer),
constraint fk_lect_subj 
  foreign key (id_lecturer, id_subject) 
  references subjects_lectures (id_lecturer, id_subject) on update cascade
);

create table students_marks(
id smallserial primary key,
id_student smallint, -- references students (id) on update cascade,
id_group smallint references groupes (id) on update cascade,
id_subject smallint references subjects (id) on update cascade,
mark smallint,
date_mark date,
constraint fk_group_subj 
  foreign key (id_group, id_subject) 
  references groupes_subjects (id_group, id_subject) on update cascade,
constraint fk_stud_group 
  foreign key (id_student, id_group) 
  references students (id, id_group) on update cascade
);

