select id_student,  avg(mark), students.first_name, students.last_name 
from students_marks  
inner join students 
on students_marks.id_student=students.id
group by id_student 
limit 5;

select s.id_student,  avg(s.mark), students.first_name, students.last_name 
from students_marks as s
join students 
on s.id_student=students.id
group by s.id_student; --students.first_name, students.last_name ;
--order by avg_mark desc
--limit 5;


--5        .

select s.first_name, s.last_name, m.av_mark
from students as s
join 
(select id_student,  avg(mark)  as av_mark
from students_marks  
group by id_student 
order by av_mark desc
limit 5) as m on s.id = m.id_student
order by m.av_mark desc;

--1        . 

select s.first_name, s.last_name,  m.id_subject, sj.name,  m.av_mark
from students as s
inner join 
(select id_student, id_subject, avg(mark)  as av_mark
from students_marks  
group by id_student , id_subject
order by av_mark desc
limit 1) as m on s.id = m.id_student
join subjects as sj on sj.id = m.id_subject
order by m.av_mark desc
;

--       .

select g.id, g.name, m.id_subject, sj.name, m.av_mark
from groupes as g
join 
(select id_group, id_subject, avg(mark)  as av_mark
from students_marks  
group by id_group , id_subject ) as m on g.id = m.id_group
join subjects as sj on sj.id = m.id_subject
;

--   .

select avg(mark)  as av_mark
from students_marks  
order by av_mark desc
limit 1
;

--    'Alan Turing'.

select sl.id_lecturer , l.first_name , l.last_name , sl.id_subject , s.name 
from subjects_lectures as sl 
join subjects as s on s.id = sl.id_subject 
join lecturers as l  on l.id = sl.id_lecturer 
where l.first_name || ' ' || l.last_name = 'Alan Turing'
;

--    'MM-11'.

select s.first_name, s.last_name
from students as s 
join groupes as g on s.id_group = g.id
where g.name = 'MM-11'
;

--    'M-111'   'math.analysis'.

select st.first_name || ' ' || st.last_name as student, mark 
from students_marks as sm 
join groupes as g on g.id = sm.id_group
join subjects as sj on sj.id = sm.id_subject
join students as st on st.id = sm.id_student
where g.name = 'M-111' 
and sj.name = 'math.analysis'
order by student 
;

--    'M-212'   'data structures'   . -

select st.first_name || ' ' || st.last_name as student, sm.mark, sj.name,  g.name, sm.date_mark 
from students_marks as sm 
join (
select id_group, id_subject, max(date_mark) as max_date 
from students_marks  
group by id_group, id_subject, id_student
) 
as sm_date on (sm.id_group, sm.id_subject, sm.date_mark ) = (sm_date.id_group, sm_date.id_subject, sm_date.max_date)
join subjects as sj on sj.id = sm.id_subject
join students as st on st.id = sm.id_student
join groupes  as g on g.id = sm.id_group
where g.name = 'M-212' 
and sj.name = 'data structures'
 
;

-- ,    'Orlando Bloom'.

select  st.full_name, st.id_group, gr.name, sj.name
from groupes_subjects as gs
join subjects as sj on sj.id = gs.id_subject 
join groupes as gr on gs.id_group = gr.id 
join 
(select first_name || ' ' || last_name as full_name , id_group
from students where first_name || ' ' || last_name = 'Orlando Bloom'
) as st on st.id_group = gs.id_group 
;

-- ,   'Nathaniel Washington'   'Grigorii Fichtenholz'.

select  st.full_name, st.id_group, gr.name, l.full_name, sj.name
from group_subject_lecturer as gsl
join subjects as sj on sj.id = gsl.id_subject 
join groupes as gr on  gr.id = gsl.id_group
join 
(select  first_name || ' ' || last_name as full_name , id
from lecturers 
where first_name || ' ' || last_name = 'Grigorii Fichtenholz'
)
as l on l.id  = gsl.id_lecturer 
join 
(select first_name || ' ' || last_name as full_name , id_group
from students 
where first_name || ' ' || last_name = 'Nathaniel Washington'
) 
as st on st.id_group = gsl.id_group 
;

-- ,   'Blaise Pascal'   'Jude Law'.

select avg(sm.mark), l.first_name || ' ' || l.last_name as full_name_l , st.first_name || ' ' || st.last_name as full_name_st
from students_marks as sm 
join group_subject_lecturer as gsl on (gsl.id_group, gsl.id_subject)=(sm.id_group, sm.id_subject)
join lecturers as l on l.id =gsl.id_lecturer
join students as st on st.id = sm.id_student 
where l.first_name || ' ' || l.last_name = 'Blaise Pascal'
and st.first_name || ' ' || st.last_name =  'Jude Law'
group by  2, 3
;

-- ,    'Bartel Leendert van der Waerden'.

select avg(sm.mark), l.first_name || ' ' || l.last_name as full_name
from students_marks as sm 
join group_subject_lecturer as gsl on (gsl.id_group, gsl.id_subject)=(sm.id_group, sm.id_subject)
join lecturers as l on l.id =gsl.id_lecturer
where l.first_name || ' ' || l.last_name = 'Bartel Leendert van der Waerden'
group by  2
;
